import React, {Component} from 'react';
import Button from "react-bootstrap/Button"
import Logo from "./Logo"
import X from "../images/1.png"
import O from "../images/0.png"

class Info extends Component{

  render(){
    return(
      <div className="container niceFont center">  
        <Logo/>
        <form >
          <div className="inptFields"> 
            <div className="lable">
              <label>Name 1<img className="icon" src={X} alt="X"/></label>
              <input type="text" name="name" />
            </div>
            <div className="lable">
              <label>Name <img className="icon" src={O} alt="O"/></label>
              <input type="text" name="name" />
            </div>
          </div>          
          <Button type="submit"  variant="dark">Start</Button>{' '} 
        </form>
      </div>
    )
  }
}


export default Info;
